import React, { useEffect, useState } from 'react';
import Logo from "../logo.svg";
import "bootstrap/dist/css/bootstrap.css";
import { NavLink, useNavigate } from "react-router-dom";
import { useAuth } from "./AuthProvider";

export default function Navbar() {
  const { logout, user } = useAuth();
  const [role, setRole] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const checkUserRole = async () => {
      if (user) {
        try {
          setIsLoading(true);
          const response = await fetch('https://localhost:3001/user/checkUser', {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({ accountnum: localStorage.getItem("accountnum").toString() }),
          });

          if (response.ok) {
            const data = await response.json();
            setRole(data.role);
          } else {
            const errorData = await response.json();
            setError(errorData.message || "Error fetching role");
          }
        } catch (error) {
          console.error("Error checking user role:", error);
          setError("Network error");
        } finally {
          setIsLoading(false);
        }
      } else {
        // Reset role and loading state when user logs out
        setRole(null);
        setIsLoading(false); 
      }
    };

    checkUserRole();
  }, [user]); 

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <NavLink className="navbar-brand" to="/">
        <img src={Logo} alt="Logo" style={{ width: '25%' }} />
      </NavLink>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav ms-auto">

          {!user && !isLoading && ( // Show login/signup when not logged in and not loading
            <>
              <li className="nav-item">
                <NavLink className="nav-link" to="/login">
                  Login
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/signup">
                  Sign Up
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/tellerLogin">
                  Employees
                </NavLink>
              </li>
            </>
          )}

          {isLoading && ( 
            <li className="nav-item">
              <span className="nav-link">Loading...</span>
            </li>
          )}

          {error && ( 
            <li className="nav-item">
              <span className="nav-link text-danger">{error}</span>
            </li>
          )}

          {user && !isLoading && role === 'user' && ( 
            <>
              <li className="nav-item">
                <NavLink className="nav-link" to="/viewtransactions">
                  View my transactions
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/newtransaction">
                  New Transaction
                </NavLink>
              </li>
            </>
          )}

          {user && !isLoading && role === 'teller' && (
            <>
              <li className="nav-item">
                <NavLink className="nav-link" to="/addTeller">
                  Add Teller
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/addViewAllTransactions">
                  View All Transactions
                </NavLink>
              </li>
            </>
          )}

          {user && !isLoading && ( 
            <li className="nav-item">
              <button className="nav-link btn btn-link" onClick={handleLogout}>
                Logout
              </button>
            </li>
          )}
        </ul>
      </div>
    </nav>
  );
}
